('page', 0, 1, 1, 'en', 0, '<p>Le site Hôtels&amp;Restos est édité par la société SuperChef, S.A.S. immatriculée au R.C.S. de Paris sous le n° B 433 434 156, dont le siège social est 1, avenue des Champs Elysées 75008 Paris.</p>\r\n\r\n<p>Les locaux de la société sont au 1, avenue des Champs Elysées. Téléphone : 01 23 45 67 89</p>\r\n\r\n<p><img alt=\"Marie-Chantal\" data-entity-type=\"file\" data-entity-uuid=\"4929ca86-7225-44f1-b9bd-87c5ff19830d\" src=\"/sites/default/files/inline-images/marie-chantale.jpg\" /><br />\r\nLe directeur de la publication est :<br />\r\nMadame Marie-Chantale Lepoutre<br />\r\n<a href=\"mailto:chacha@superchef.org\">chacha@superchef.com</a></p>\r\n\r\n<p><img alt=\"Giga hébergeur\" data-entity-type=\"file\" data-entity-uuid=\"bce183e5-b33b-4e3f-87c8-197f33bb6ebe\" src=\"/sites/default/files/inline-images/hebergeur.jpg\" /><br />\r\nL’hébergeur du site est la société :<br />\r\n<strong>Giga Hébergeur</strong><br />\r\n2, avenue des Champs Elysées<br />\r\n75008 Paris.</p>\r\n', '', 'basic_html'),
('page', 0, 2, 2, 'en', 0, '<p>Toutes les informations diffusées sur le site n\'engage que le responsable du site et en aucune manière les propriétaires des établissements (hôtel ou restaurant).</p>\r\n\r\n<p>Dans tous les cas, vous ne pouvez pas utiliser les textes et/ou photos pour en faire un usage commercial.</p>\r\n\r\n<p>Les informations diffusées sur le site sont incorporées dans une base de données appartenant à la société SuperChef, vous ne pouvez ni reproduire cette base de données, ni extraire des données contenues dans cette base autrement que pour votre usage privé.</p>\r\n\r\n<p>Pour connaître les possibilités de partenariats, retrouvez nos coordonnées sur la page <a href=\"/qui-sommes-nous\"><em>Qui-sommes-nous ?</em></a>, ou contactez Marie-Chantale sur <a href=\"mailto:chacha@superchef.com\">chacha@superchef.com</a>.</p>\r\n', '', 'full_html'),
